function replaceSubstrForBalancedString(str) {
    let countMap = {Q: 0, W: 0, E: 0, R: 0};
    let n = str.length;
    let updateMap = {};
    let requiredSizeOfEachCharacter = parseInt(str.length / 4);
    for (let i = 0; i < n; i++) {
        countMap[str[i]] = ++countMap[str[i]];
    }
    Object.keys(countMap).forEach(char => {
        if (countMap[char] > requiredSizeOfEachCharacter) {
            updateMap[char] = Math.abs(requiredSizeOfEachCharacter - countMap[char]);
        }
    });
    console.log('updateMap', updateMap);
    let minCharChangeLength = Object.keys(updateMap).reduce((totalChars, key) => updateMap[key] + totalChars, 0);

    for (let j = minCharChangeLength; j <str.length; j++) {
        for (let slidingWindowOffset = 0; slidingWindowOffset <= str.length - j; slidingWindowOffset++) {
            let currSubStr = str.substring(slidingWindowOffset, slidingWindowOffset + j);
        

            if (Object.keys(updateMap).every(key => {
                let currKeyCount = (currSubStr.match(new RegExp(key, "g")) || []).length;
                return currKeyCount >= updateMap[key]})) {
                return j;
            }
        }
    }

    
    return 0;
}

